import React, { useState } from 'react';

function TaskerProfile() {
  const [image, setImage] = useState(null);
  const [area, setArea] = useState('');
  const [city, setCity] = useState('');
  const [state, setState] = useState('');
  const [pincode, setPincode] = useState('');
  const [bio, setBio] = useState('');

  const userID = localStorage.getItem('userID');  // Get user ID from local storage
  const userName = localStorage.getItem('name'); // Get user name from local storage

  const handleImageChange = (event) => {
    setImage(event.target.files[0]);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append('image', image);
    formData.append('area', area);
    formData.append('city', city);
    formData.append('state', state);
    formData.append('pincode', pincode);
    formData.append('bio', bio);
    formData.append('userID', userID);  // Send userID as well

    try {
      const response = await fetch('/api/tasker-profile', {
        method: 'POST',
        body: formData,
      });

      if (response.ok) {
        // Handle success (e.g., show a success message)
        console.log('Profile updated successfully');
      } else {
        // Handle error (e.g., show an error message)
        console.error('Error updating profile');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold text-gray-800">{userName}'s Tasker Profile</h1>
      <form onSubmit={handleSubmit} className="mt-4 bg-white p-6 rounded-lg shadow-md">
        <div className="mb-4">
          <label className="block text-gray-700">
            Name:
            <input
              type="text"
              value={userName}
              readOnly
              className="mt-1 block w-full border rounded p-2 bg-gray-100 cursor-not-allowed"
            />
          </label>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700">
            Upload Image:
            <input
              type="file"
              onChange={handleImageChange}
              className="mt-1 block w-full border rounded p-2"
              required
            />
          </label>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700">
            Area:
            <input
              type="text"
              value={area}
              onChange={(e) => setArea(e.target.value)}
              className="mt-1 block w-full border rounded p-2"
              required
            />
          </label>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700">
            City:
            <input
              type="text"
              value={city}
              onChange={(e) => setCity(e.target.value)}
              className="mt-1 block w-full border rounded p-2"
              required
            />
          </label>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700">
            State:
            <input
              type="text"
              value={state}
              onChange={(e) => setState(e.target.value)}
              className="mt-1 block w-full border rounded p-2"
              required
            />
          </label>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700">
            Pincode:
            <input
              type="text"
              value={pincode}
              onChange={(e) => setPincode(e.target.value)}
              className="mt-1 block w-full border rounded p-2"
              required
            />
          </label>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700">
            Bio:
            <textarea
              value={bio}
              onChange={(e) => setBio(e.target.value)}
              className="mt-1 block w-full border rounded p-2"
              rows="4"
              placeholder="Tell us about yourself..."
            />
          </label>
        </div>

        <button type="submit" className="mt-4 bg-blue-500 text-white p-2 rounded hover:bg-blue-600">
          Submit Profile
        </button>
      </form>
    </div>
  );
}

export default TaskerProfile;
